import "./assets/sass/sass-components/App/app.scss";

import Mainsection from "./components/main-page-components/main-section";
import Nav from "./components/container-components/navbar-container";

function App() {
  return (
    <div className="app-container">
      <NavbarContainer navCurrentPath="/Home" />
      <Mainsection />
    </div>
  );
}

export default App;
